  true,\n\t\"url\": null,\n\t\"notes\": \"This map shows new construction and major
  R&A projects in federal buildings under GSAu2019s custody and control that are above
  the current prospectus threshold of $2.85 million. New construction and major R&A
  projects for two different fiscal years are displayed on the map. Projects for FY2014
  were funded as part of the Consolidated Appropriations Act of 2014, and GSA will
  begin to execute these projects this year. Projects for FY2015 have been included
  in the Presidentu2019s Budget request, but require approval and funding from Congress
  before the projects can begin.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
